import React from 'react';
import { Card, Container } from 'react-bootstrap';
import './ChurchGatePage.css'; // we'll use a bit of custom CSS here

const ChurchGatePage = () => {
  return (
    <Container fluid className="church-gate-wrapper mt-4 p-0 d-flex justify-content-center">
      <div className="position-relative" style={{ width: '80vw' }}>
        <img
          src="https://via.placeholder.com/1200x600"
          alt="Church Gate"
          className="img-fluid w-100 rounded"
        />
        <Card className="church-gate-card position-absolute">
          <Card.Body className="py-2 px-3">
            <Card.Title className="mb-0 h6">Church Gate 2</Card.Title>
          </Card.Body>
        </Card>
      </div>
    </Container>
  );
};

export default ChurchGatePage;
